import React from 'react';
import List from '@mui/material/List';
import Track from '../Track/Track';

function Tracklist({ tracks, isRemoval, onAdd, onRemove }) {
  return (
    <List className="tracklist">
      {tracks.map(track => (
        <Track 
          key={track.id}
          track={track}
          isRemoval={isRemoval}
          onAdd={onAdd}
          onRemove={onRemove}
        />
      ))}
    </List>
  );
}

export default Tracklist;
